import React from "react";
import { Outlet } from "react-router";
import Navbar from "components/Navbar";
import TopBar from "components/TopBar";
import SiteLogo from "components/SiteLogo";

const MainLayout = () => {
  return (
    <>
      <header>
        <TopBar />
        <SiteLogo />
        <Navbar />
      </header>
      <main>
        <Outlet />
      </main>
      <footer></footer>
    </>
  );
};

export default MainLayout;
